import React from "react";

import "../styles.css";

function Note(props) {
    let deleteNote = (event) => {
        let title = event.target.parentNode.children[0].value;
        console.log(title)
    }

    return (
        <div className="col-md-4 col-lg-2">
            <div className="card container-fluid" value={props.id}>
                <p className="note-title">{props.title}</p>
                <p className="note-content">{props.content}</p>
                <p onClick={deleteNote} className="delete-note">DELETE</p>
            </div>
        </div>
    );
}

export default Note;
